import React from 'react';
import CardCard from '../../Components/Card/CardCart/CardCard';

const Cart = () => {
  return (
    <>
      <div className="text-3xl p-2 font-semibold">You Have Orderd:</div>
      <CardCard />
    </>
  );
};

export default Cart;
